import React from 'react'

export default function ProjectElement(props) {
    return (
        <div className="projectElement">
            <img src={`../images/${props.item.coverImg}`} alt="lol" className="journeyImg" />
            <h3>{props.item.title}</h3>
            <p href={props.item.longDescription}>{props.item.shortDescription}</p>
            <span><h1>{props.item.title}</h1></span>
            <p className="journey-description">{props.item.language}</p>

        </div>
    )
}
